import React from "react";
import RenderHtml from "react-native-render-html";
import { useWindowDimensions, ScrollView } from "react-native";
import statisticsHtml from "../Statistics/statistics.html"; // Stelle sicher, dass Webpack html-loader unterstützt

const Graphs = () => {
    const { width } = useWindowDimensions();

    // HTML-String aus der Datei laden
    const source = {
        html: statisticsHtml
    };

    return (
        <ScrollView style={{ flex: 1, padding: 10 }}>
            <RenderHtml
                contentWidth={width}
                source={source}
            />
        </ScrollView>
    );
};

export default Graphs;
